Para limitar mod-harbour yo propongo que simplemente en Apache.prg detallemos las funciones no permitidas:


function error_()
RETURN Alert("funcion no permitida !!")

function directory(); return error_()
function fDelete(); return error_()

Y las otras funciones modificarlas.

funcion file(cFile)

if ! "htcdocs" $ TrueName(cFile) )
   Alert("Directorio inválido !")
endif

return nil


Esto podria implicar sacar Harbour de Contribs, si finalmente entrara.

Habría que hablar con los másters de Harbour a ver qué piensan. ¿ Quien hay a cargo ?
